import YouTube from 'react-youtube';


export default class VideoPlayer extends React.Component {
    render() {
        return <ReactPlayer url='https://youtu.be/lrcDzmIGXWs?list=PL-3W-zZzHzX_3T63nVAH5EmNAhxBIUed7' controls />
    }
}
